import { Link } from "react-router-dom";
import Lib from "./images/lib.jpg";
const Home = () => {
  return (
    <>
      <div className="text-center">
        <h4 className="text-center" style={{fontFamily: "sans-serif"}}>Find a Book to read</h4>
        <hr className="mb-1"></hr>
        <Link to="/books">
          <img
            className="img-fluid img-thumbnail"
            src={Lib}
            alt="books.img"
          ></img>
        </Link>
      </div>
    </>
  );
};

export default Home;
